textOriginal:
quem luta pela democracia é o lula,,Maneira besta de falar que o lula apoia ditadura e comunismo,,Se lula quisesse uma ditadura ele nao falava tanto dos direitos do povo e nao defendia,,entao esta ideia de lula apoia ditaduta e comunismo é tola,,
No comunismo o povo nao tem direito,,Olha so o governo atual,,corte na farmacia popular,,tirando remedio dos mais pobres,,corte na moradia,,privatizaçao do sus,,venda de praias,,
Quem é mesmo que ta contra o povo,,Recentemente guedez quer diminuir o salario minimo;
